const KMP = (str, substr) => {
  let n = str.length;
  let m = substr.length;
  let lps = [];
  [...substr].forEach(val => lps.push('0'))
  let counter = 0


  // Fn to calculate the lps
  const computeLPS = (substr, m, lps) => {
    let length = 0
    let i = 1;
    lps[0] = 0
    while (i < m) {
      if (substr[i] === substr[length]) {
        lps[i] = length + 1
        length++
        i++
      } else {
        if (length !== 0) {
          length = lps[length - 1]
        } else {
          lps[i] = 0
          i++
        }
      }
    }
  }
  
  computeLPS(substr, m, lps)
  // Two different pointers for the str and substr
  let i = 0;
  let j = 0;

  // scan through entire text input to find the pattern so loop 
  while (i < n) {
    if (str[i] === substr[j]) {
      i++
      j++
    } else {

      // for below ex, we know that there is mism in 5th index
      // when there is a mismtch in 5th ind, we know that the pattern from 0 to 4 is perfect match 
      // so if we go to LPS table and check what the val is @ 4th ind, it tells us length of longest prefix that is also a suffix until this pt. --> 2
      // When we see 2, we undesrtand that the 0th and 1st index of substr are already matching w/ previous chars of str
      // remember:  i and j are currently 5 when mismatch occurs 
      // so we can directly start comparison at the 2nd index of substr --> j = lps[j-1] 
      // we have changed j (substr pointer) to the val of lps table @ that the index before mismatch 
      // but we cannot do that when j = 0 (when first char is mismatch)
      // if first char is mismatch, then we just increment i and leave j the same
      if (j !== 0) j = lps[j - 1]
      else i++;
    }
    if (j === m) {
      // implement counter if needed
      counter++
      // console.log(`Occurence: Index ${i - j}`) //gives index occurence
      j = lps[j - 1] //to keep going
    }

  }

  return counter
  // console.log(lps)
}




